module.exports = "<div class=\"my-contain\">\n    <div class=\"card my-card big-card\">\n        <div class=\"header  d-flex\">\n            <div class=\"accent-icon mr-auto\">\n                <i class=\"fa fa-heart\"></i>\n\n            </div>\n            <div class=\"header-title\">\n\n                <span class=\"title-text\">C3PO-QI</span>\n\n            </div>\n        </div>\n        <div class=\"card-body text-center text-md-left p-4\">\n\n\n            <p>\n                In early 2013 the C3PO collaboration began a new phase of progress, known as the Congenital Cardiac Catheterization Project\n                on Outcomes-Quality Improvement (C3PO-QI), and expanded their participation to 15 institutions. The C3PO-QI\n                group is working to move beyond benchmarking and towards improving patient care practices through various\n                quality improvement initiatives.\n\n            </p>\n\n            <p>\n                The group has expanded participation to include 15 sites and began prospectively collecting data in May of 2013. For this\n                new venture, the previously established web based tool was redesigned utilizing Silverlight technology and\n                features improved speed, functionality, and updated nomenclature. Institutional data is available in comparison\n                to other participating C3PO-QI sites in aggregate including procedure counts, limited patient and procedural\n                characteristics, and outcomes such as highest severity adverse events and transfusion rates. Quality reports\n                include outcome metrics such as risk adjusted adverse event ratios using CHARM. A time series analysis allows\n                sites to track performance over time by physicians and institution in comparison with other sites in aggregate.\n                To portray data in a fashion that is quickly responsive to system improvements, control charts will be created,\n                and or uncommon adverse events, time and/or number of cases between specific adverse events will be reported.\n\n            </p>\n            <p>\n                The initial goal of the C3PO-QI collaboration is to reduce radiation exposure in pediatric cardiac catheterization interventions.\n                To work towards this reduction, established QI scientific methodology is being utilized. A key driver diagram,\n                a common QI design tool which summarizes the key factors thought to have a potential impact on our goal,\n                and strategies or changes for improvement was created. (Figure 1) Subsequently, PDSA methodology will be\n                employed which involves 1) proposing changes based on hunches and theories (Plan), 2) implementing the change\n                (Do), 3) measuring or describing the effect (Study), and 4) reviewing and upgrading the process based on\n                what is learned (Act).\n\n            </p>\n        </div>\n        <div class=\"card-block\">\n            <a class=\"full-width\"  href=\"/assets/images/KDD.png\" target=\"_blank\" >\n                <img class=\"full-width\" src=\"/assets/images/KDD.png\"alt=\"C3PO-QI Goals\">\n            </a>\n           \n        </div>\n        <div class=\"card-body\">\n            <p>\n                In addition to radiation reduction, the C3PO-QI group will also look at efficacy outcomes for six specific lesion types:\n                Pulmonary Stenosis, Aortic Stenosis, Coarctation of the Aorta, Atrial Septal Defect, Patent Ductus Arteriosus,\n                and Transcatheter Pulmonary Valve Placement.\n\n            </p>\n        </div>\n\n    </div>\n</div>\n\n\n\n\n"

