module.exports = "<div class=\"my-contain\">\r\n  <div class=\"card my-card big-card\">\r\n    <div class=\"header  d-flex\">\r\n      <div class=\"accent-icon mr-auto heart-icon\">\r\n        <svg _ngcontent-c8=\"\" xmlns:svg=\"http://www.w3.org/2000/svg\" id=\"svg2\" preserveAspectRatio version=\"1.0\" viewBox=\"0 0 630 560\"\r\n             xmlns=\"http://www.w3.org/2000/svg\">\r\n          <defs _ngcontent-c8=\"\" id=\"defs4\"></defs>\r\n          <g _ngcontent-c8=\"\" id=\"layer1\" style=\"transform: scale(0.90) translate(4%, 1%);margin-left:10px;\">\r\n            <path _ngcontent-c8=\"\" d=\"M 297.29747,550.86823 C 283.52243,535.43191 249.1268,505.33855 220.86277,483.99412 C 137.11867,420.75228 125.72108,411.5999 91.719238,380.29088 C 29.03471,322.57071 2.413622,264.58086 2.5048478,185.95124 C 2.5493594,147.56739 5.1656152,132.77929 15.914734,110.15398 C 34.151433,71.768267 61.014996,43.244667 95.360052,25.799457 C 119.68545,13.443675 131.6827,7.9542046 172.30448,7.7296236 C 214.79777,7.4947896 223.74311,12.449347 248.73919,26.181459 C 279.1637,42.895777 310.47909,78.617167 316.95242,103.99205 L 320.95052,119.66445 L 330.81015,98.079942 C 386.52632,-23.892986 564.40851,-22.06811 626.31244,101.11153 C 645.95011,140.18758 648.10608,223.6247 630.69256,270.6244 C 607.97729,331.93377 565.31255,378.67493 466.68622,450.30098 C 402.0054,497.27462 328.80148,568.34684 323.70555,578.32901 C 317.79007,589.91654 323.42339,580.14491 297.29747,550.86823 z\"\r\n                  id=\"path2417\" style=\"fill:none;stroke: #fff;stroke-dasharray: 50,20;stroke-width:60px;stroke-dasharray: 50,35;\"></path>\r\n            <g _ngcontent-c8=\"\" id=\"g2221\" transform=\"translate(129.28571,-64.285714)\"></g>\r\n          </g>\r\n        </svg>\r\n      </div>\r\n      <div class=\"header-title\">\r\n        <span class=\"title-text\">C3PO</span>\r\n      </div>\r\n    </div>\r\n    <div class=\"card-body text-center text-md-left p-4\">\r\n      <h5>Overview</h5>\r\n      <p>\r\n        The Congenital Cardiac Catheterization Project on Outcomes (C3PO) is an ongoing, multi-center registry that\r\n        began prospectively collecting data from 8 participating centers in 2007.  The goals of the C3PO collaborative\r\n        group included the development of methods to assess and compare outcomes, while exploring measures of procedural\r\n        efficacy.  Utilizing an investigative dataset, collected in the registry between 2007 and 2010, the C3PO project\r\n        yielded baseline rates for adverse events, defined procedure type risk categories, and identified indicators of\r\n        hemodynamic vulnerability.  This data was then used to develop a risk adjustment model, now known as\r\n        CHARM (Congenital Heart Adjustment for Risk Method), which made the equitable comparison of adverse\r\n        event rates among institutions possible.  This metric received full endorsement from the National Quality\r\n        Forum (NQF) in 2012 as a pediatric quality measure.\r\n      </p>\r\n      <h5>C3PO Data Collection and Reporting</h5>\r\n      <p>\r\n        A web-based application for data entry was created specifically for the C3PO project using Microsoft Visual Studio NET tools.\r\n        All data entry was securely protected by SSL encryption and role-based security parameters were built-in to prevent unauthorized access to data.\r\n        Data entry occurred at the time of the catheterization procedure and was completed by the physician performing the procedure or a designee.\r\n        Patient and procedural variables as well as the occurrence of adverse events were recorded on all cases performed at the institution.\r\n\r\n      </p>\r\n      <p>\r\n        To validate the data entered, the sponsor provided monthly exception reports to highlight missing data fields or data that was out of range requiring validation.\r\n        Additionally, the sponsor provided all participating sites a list of all cases that were entered in to the database to verify against their institutional records.\r\n        To prevent coding variations, all adverse events (AEs) were reviewed by the principal investigator and a designee for proper definition of the seriousness and preventability of the episode.\r\n        After 15 months of data collection, an independent audit was conducted at each site by the sponsor.\r\n        A random sample of 10% of the sites cases were reviewed for accuracy and completeness by comparing information entered in to the database to information in the medical records.\r\n\r\n      </p>\r\n      <h5> C3PO Development of Outcome Assessment Tools</h5>\r\n      <b>Procedure-Type Risk Categories</b>\r\n      <p>\r\n        A prior single center retrospective study categorized procedure types by anticipated similar risk of AE occurrence, according to expert opinion, utilizing consensus methodology.Although this worked well, the C3PO group worked to further define the procedure-type risk categories by employing both\r\n        consensus and empirical methodologies to the investigative dataset (2007-2010) to improve the generalizability of the data.  The cases were parsed into the appropriate risk categories (1-6) as defined by Bergersen et. al., and in July 2009 the C3PO group collaborated to further empirically define the categories.  The outcome of the analysis done by the group was the creation of four procedure risk categories.\r\n      </p>\r\n      <b>Hemodynamic Vulnerability</b>\r\n      <p>\r\n        The previous single-center analysis provided a correlation between supposed hemodynamic indicators and the occurrence of adverse events through the use of subjective definitions and not data models.  The C3PO group assessed eight separate hemodynamic variables for inclusion in the final risk method: cardiac index, right ventricular (RV) systolic pressure, RV to systemic pressure ratio, systemic ventricle end-diastolic-pressure, mixed venous saturation, systemic arterial saturation, main pulmonary artery systemic pressure, and main pulmonary artery mean pressure.  Multivariable modeling produced four indicators of hemodynamic vulnerability independently related to the occurrence of high severity AEs: systemic ventricular end-diastolic pressure ≥ 18mmHg, systemic arterial saturation &lt;95% (or &lt; 78% if single ventricle (SV)), mixed venous saturation &lt; 60% (or &lt; 50% if SV), and pulmonary artery systolic pressure ≥ 45mmHg (or mean ≥ 17 if SV).\r\n\r\n      </p>\r\n      <h5><b> CHARM</b></h5>\r\n      <p>\r\n        The final CHARM model developed by the C3PO group combined the patient and procedural characteristics that correlated to the occurrence of AEs: procedure-type risk category, number of hemodynamic indicators, and age&lt;1year.  Using the CHARM methodology, institutions can compute the predicted probability of an AE for all cases at their institution.  The sum of all predicted probabilities gives the expected number of AE occurrences, taking in to consideration the case mix within the data set.\r\n        To make a comparison between institutions or physicians at one institution, the standardized adverse event ratio (SAER) must be calculated.  To compute the SAER the observed AE rate (number of level 3/4/5 AEs in the dataset divided by total number of cases) is divided by the expected AE rate (expected number of AE occurrences divided by total number of cases).\r\n      </p>\r\n      <img src=\"/assets/images/SAERGraph.png\" Width=\"500\">\r\n   \r\n    <h5> Efficacy and Outcome Assessment</h5>\r\n    <p>\r\n      In addition to the creation of the CHARM method, the C3PO investigative dataset also yielded measures of procedural efficacy in population subsets.  PA rehabilitation was found to be associated with a 10% incidence of high-level severity AE.  Hemodynamic vulnerability, young age, use of cutting balloons, and lower operator experience were significant independent risk factors for procedure-related AE.  Hybrid procedures were among the interventions investigated and were found to have a low incidence of major AE occurrence.  Procedural success is common and AEs, especially higher severity AEs, are rare for balloon pulmonary valvuloplasty in patients with isolated pulmonary valve stenosis.  Cardiac catheterizations involving endomyocardial biopsies can be performed in pediatric heart transplant recipients with a low AE rate and high diagnostic yield.\r\n    </p>\r\n    <b> Future Directions</b>\r\n      <p>\r\n        The next phase for C3PO is to move beyond definition toward quality improvement (QI) initiatives aimed at improving the outcomes for all patients undergoing catheterization with congenital heart disease.  The group will be expanding participation to include 15 sites and will begin prospectively collecting data in May of 2013.   For this new venture, the previously established web based tool has been redesigned utilizing Siverlight technology and features improved speed, functionality, and updated nomenclature.  Institutional data will be available in comparison to other participating C3PO-QI sites in aggregate including procedure counts, limited patient and procedural characteristics, and outcomes such as highest severity adverse events and transfusion rates.  Quality reports will include outcome metrics such as risk adjusted adverse event ratios using CHARM.  A time series analysis will allow sites to track performance over time by physician and institution in comparison to other sites in aggregate.  To portray data in a fashion that is quickly responsive to system improvements, control charts will be created, and for uncommon adverse events, time and/or number of cases between specific adverse events will be reported.\r\n        <br />\r\n        <br />\r\n        The initial goal of the new C3PO-QI collaboration is to reduce radiation exposure in pediatric cardiac catheterization interventions.  To work towards this reduction, established QI scientific methodology will be utilized.  Initially, a key driver diagram, a common QI design tool which summarizes the key factors thought to have a potential impact on our goal, and strategies or changes for improvement will be created.  Subsequently, PDSA methodology will be employed, which involves 1) proposing changes based on hunches and theories (Plan), 2) implementing the change (Do), 3) measuring or describing the effect (Study), and 4) reviewing and upgrading the process based on what is learned (Act).\r\n        <br />\r\n        <br />\r\n        In addition to radiation reduction, the C3PO-QI group will also look at efficacy outcomes for six specific lesion types: Pulmonary Stenosis, Aortic Stenosis, Coarctation of the Aorta, Atrial Septal Defect, Patent Ductus Arteriosus, and Transcatheter Pulmonary Valve Placement.\r\n        <br />\r\n      </p>\r\n  </div>\r\n  \r\n</div>\n\n    \n\n\n</div>\n"

